import classes from './Container.module.css';
import Buttons from './Buttons/Buttons';
import MainImage from './MainImage';
import Authorization from './Authorization/Authorization';
import {Routes, Route} from 'react-router-dom';
import { NewsSection } from '../NewsSection';
import { TaskBank } from '../TaskBank';
import { Documents } from '../Documents';


const Container = () => {
  return (
    <div className={classes.Container}>
      <main className={classes.Content}> 
      <Buttons href={'/'} text={'Архив заданий регионального этапа ВсОШ по физике'}></Buttons>
      <Buttons href={'#News'} text={'Новости'} ></Buttons>
      <Buttons href={'#Documents'} text={'Документы'} ></Buttons>
      <MainImage src='./girl.png'/>
      <Authorization/>
      </main>
      <Routes>
        <Route path="/archive" element={<TaskBank/>}/>
        <Route path="/news" element={<NewsSection/>}/>
        <Route path="/documents" element={<Documents/>}/>
      </Routes>
      
    </div>
  )
}

export default Container;
